import React, { Component } from 'react';
import Button from '@material-ui/core/Button';

class Continuar_bot extends Component{
    render(){
        return (           
            // <button onclick="newBiblioteca()">Continuar</button> 
            <Button variant="contained" color="primary">
                     Continuar
               
            </Button>
         
        );
    }
    
}

export default Continuar_bot;

